SVGGenerator.sol.content:
import "defs.sol";

contract SVGGeneratorVer1 is ISVGGenerator {
    function generate(NFTMeta memory meta)
        public
        pure
        returns (string memory)
    {
        return string.concat(
            '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" viewBox="0 0 500 500">',
            '</svg>'
        );
    }
}

defs.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8;

struct NFTMeta {
    uint256[] other_data;
    uint256[] leyers;
    string base_serial;
    IRakugakiLayers layers_database;
    ISVGGenerator generator;
}

struct RakugakiLayer {
    string image;
    uint256 timestamp;
}

interface IRakugakiLayers {
    function getLayer(uint256) external returns (RakugakiLayer memory);
}

interface ISVGGenerator {
    function generate (NFTMeta memory meta) external view returns (string memory);
}

